import React from 'react';
import './App.css';
import Header from './components/header';
import Navbar from './components/Navbar';
import Profile from '.component/Profile';



const App = () => {
  return (
    <div className= 'app-wrapper'>
      <Header />
      <Navbar />
      <Profile />



    </div>
  );
}



export default App;
